import React, {Component} from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { robots } from "./robots";


class App extends Component {
    constructor(props) {
        super();
        this.state = {
            robots : robots,
            searchfields : '',
        };
    }
    render() {
    return (
        <div className="tc">
            <h1>Robot Friends</h1>
            <SearchBox/>
            <br/>
            <CardList robots={this.state.robots}/>
        </div>
    )
}
}

export default App;
